(94, 2122, 'Под заказ.\nПродам комплект [+LIST=114;ITEM=RAND+]\nR[+ATTR=9+] [+ATTR=5;REPLACE={*=/};SEP=-+] [+LIST=115;ITEM=RAND+]\n[+LIST=109;ITEM=RAND+]\nВозможна отправка в регионы!! \nET +[+ATTR=32+], Ширина [+ATTR=31+]JJ'),
