(95, 1062, '{Спасибо за внимание к нашему объявлению|Приветствуем вас в нашем каталоге|Шины диски б/у}\nНаходимся в Екатеринбурге, есть наличие, но большинство товара поставляем на заказ! С глупыми вопросами не звонить. Все привозы по полной предоплате, выбираете по фото на нашем сайте.\n[+ATTR=7+]/[+ATTR=8+]/[+ATTR=9+]\nМарка:[+ATTR=16+] [+ATTR=17+]\nСостояние: [+ATTR=26+]\nКоличество:  [+ATTR=28+]шт.\nИндексы: [+ATTR=18+][+ATTR=19+]\nСезонность: [+ATTR=23+]\nОстаток протектора:[+INTER=41+]\n{Гарантия качества|Прямые поставки из Японии|4 Года на рынке|Только положительные отзывы о нашей работе} \n'),
(95, 1063, '[+LIST=108;ITEM=RAND+]\n[+LIST=92+], [+LIST=109;ITEM=RAND+]\n[+LIST=118;ITEM=RAND+]');
INSERT INTO `data_dictionary_variant` (`dictionary_id`, `attribute_1`, `value`) VALUES
(95, 1065, 'Отличные качественные шины. В хорошем состоянии, без порезов, без грыж. Все имеющиеся недостатки указаны на фото (дополнительные фото скину на почту).\nДиаметр [+ATTR=9+]'''', ширина [+ATTR=7+] мм, профиль [+ATTR=8+]%, износ [+ATTR=29+]%, количество [+ATTR=28+].\nШины поставляются под заказ.\nОбменом не занимаюсь! Звонить только по поводу покупки!\nПродаются только шины (БЕЗ ДИСКОВ)!'),
(95, 1066, 'Находимся в Краснодаре, но шины поставляются под заказ.\nБез дисков.\n[+ATTR=16+] [+ATTR=17+] ширина [+ATTR=7+] профиль [+ATTR=8+] диаметр [+ATTR=9+]\n[#{Звоните, или пишите|Пишите или звоните} - всем отвечу.#]\n[#{(Без обмена, возможно пойду на торг.)|(Обмен не предлагать, возможен торг.)}#]'),
(95, 1067, 'Находимся в Красноярске. Шины поставляются под заказ!\nДаем гарантию отсутствия грыж и порезов.\n[+ATTR=16+] [+ATTR=17+]\nдиам [+ATTR=7+] шир [+ATTR=8+] проф [+ATTR=9+]\nГод выпуска: [+ATTR=10+]\nMade in: [+ATTR=11+]\n{Отличные шины за эти деньги|Хорошие шины за умеренную цену|Нормальные шины за нормальную цену|Качественные шины по демократичной цене|Выгодное предложение|Прекрасная цена за такой комплект шин|Для такого состояния шин цена приятная|За такие деньги - отличный вариант шин}\nОбмен не интересен. Продаются без дисков.\n'),
(95, 1069, 'Продам отличные шины. [+LIST=53+].\n[#Поставляются под заказ, [+INTER=113+] дней. Строго полная предоплата#]\n[#Цена указана за [+LIST=137+]#]\n[#[+ATTR=7+]х[+ATTR=8+]х[+ATTR=9+]#]\n[#[+ATTR=16+]#]\n[#[+ATTR=17+]#]\n[#Обмен, торг,болтовня - не интересны#]\n'),
(95, 1070, 'Продам диски [+LIST=92+]\n[+LIST=118;ITEM=RAND+]\n[+LIST=108;ITEM=RAND+]\nДиски не новые, состояние на фото.\nПодробные фотографии и доп. информация - по телефону, либо отправьте сообщение.'),
(95, 1071, 'Находимся в Новосибирске, указанный товар поставляется на заказ!\n{Работаем по всей стране|Продам шины|Поставляем бу шины|В данном комплекте шины:|Уточняйте информацию по телефону|Чтобы отправить нам сообщение нажмите кнопку "задать вопрос продавцу"}\n[+ATTR=7+]-[+ATTR=8+]-[+ATTR=9+]. [+ATTR=28+]шт. [+ATTR=16+] [+ATTR=17+]. [+ATTR=26+] [+ATTR=23+] [+ATTR=18+][+ATTR=19+]\nОбмена нет. Иногда мы готовы обсудить торг.\n{Большой выбор шин и дисков в наличии и под заказ|Отправка в регионы.|Гарантия качества|На рынке 4 года|Шины без грыж и порезов|Обращаем ваше внимание что товар на заказ|С тупыми вопросами не звонить}'),
(95, 1072, 'Диски б/у на [+ATTR=9+] d, `("[+LIST=91+]"==""|"[+LIST=91+]"=="Не указано")?(""):("пр-во [+LIST=91+],")` [+ATTR=5+] ширина [+ATTR=31;SEP=-+]J\n[+LIST=108;ITEM=RAND+]\nСрок поставки до 15 дней.'),
(95, 1073, '[+LIST=92+]\nПод заказ! Поставка [+INTER=113+] дней после полной оплаты в нашем представительстве в г. [+ATTR=38+].\nДиски не гнутые, состояние на фото.\n[+VAR=avito_s;ITEM=RAND+]. Без шин'),
(95, 1074, 'Продам диски [+LIST=109;ITEM=RAND+] `("[+LIST=91+]"==""|"[+LIST=91+]"=="Не указано")?(""):("пр-во [+LIST=91+],")`\nсверловка [+ATTR=5;SEP=-;REPLACE={*=x}+] \nширина [+ATTR=31;SEP=-+]\n[+LIST=118;ITEM=RAND+]\n[^Товар на заказ! ~Без обмена! ~Без шин! ~Подробности по телефону или пишите сообщения.^]'),
(95, 1077, '[#[+LIST=92+]\n#][#[+LIST=121;ITEM=RAND+] [+ATTR=33+](мм) выл. [+ATTR=32+](мм)\n#][#[+LIST=108;ITEM=RAND+]\n#][#[+LIST=118;ITEM=RAND+]\n#]'),
(95, 1081, 'Продам б/у резину [+ATTR=16+] [+ATTR=17+]\n[+ATTR=7+]/[+ATTR=8+]/[+ATTR=9+]\nКоличество: [+ATTR=28+] шт.\nСезонность: [+ATTR=23+].\nОстаток протектора: [+INTER=41+].\nГарантия того, что шины без грыж и порезов. Общее состояние можете увидеть на фотографиях.\nТолько продажа! По поводу обмена не беспокоить!'),
(95, 1409, 'Диски поставляются на заказ.\n{Отличное|Хорошее} литье на [+ATTR=9+], Совместимость с вашим {авто|автомобилем} смотрите по параметрам, [#возвратов по причине неправильного выбора размера не делаю#], [#все параметры указаны#], [#{пишите вышлю еще фото|вышлю доп. фото}#].\n{Доп. инфо по телефону|Звоните, отвечу на дополнительные вопросы}'),
(95, 2122, 'Под заказ.\nПродам комплект [+LIST=114;ITEM=RAND+]\nR[+ATTR=9+] [+ATTR=5;REPLACE={*=/};SEP=-+] [+LIST=115;ITEM=RAND+]\n[+LIST=109;ITEM=RAND+]\nВозможна отправка в регионы!! \nET +[+ATTR=32+], Ширина [+ATTR=31+]JJ'),
