(98, 1783, 'Колеса 5шт.'),
(98, 2217, 'Колеса 6шт.'),
(99, 399, 'Колеса в сборе, без пробега по РФ.'),
(99, 400, 'Колеса в сборе б/у.'),
(99, 818, 'Колеса в сборе, новые.'),
(100, 1560, 'ПРОДАЮТСЯ КОЛЕСА В ПУТИ, Т.Е. ПРАВО ПОЛУЧИТЬ ЛОТ С ЯПОНСКОГО АУКЦИОНА "КАК ЕСТЬ" без гарантий с нашей стороны. Делая ставку покупатель соглашается с условиями сделки.\nПродам колеса, куплены [+ATTR=97+] на японском аукционе. Находятся в пути, сроки поставки от указанной даты 21-60 дней. Если в течение 60 дней вы не получите товар - имеете право на возврат денег в размере уплаченной суммы. \nМы перепродаем вам право получить товар с японского аукциона купленный на основании предоставленных фото. Товар, его параметры, состояние, комплектация и пр. могут отличаться от фото/описания по вине японской стороны. Данные риски компенсируются низкой ценой, их берет на себя покупатель. Поле износ шин заполнено по нашей субъективной оценке. Реальный остаток смотрите по фото. Других фото, кроме приложенных нет. Товар отправляется вам без проверки, в состоянии, в котором поступил из Японии. '),
(100, 1600, '[+INTER=149+]'),
(100, 1601, 'ПРОДАЮТСЯ КОЛЕСА, СВЕЖИЙ ПРИХОД, НЕ РАСПАКОВЫВАЛИ, Т.Е. С ЯПОНСКОГО АУКЦИОНА "КАК ЕСТЬ" без гарантий с нашей стороны. Делая ставку покупатель соглашается с условиями сделки.\nПродам колеса, куплены на японском аукционе. Находятся в г. Владивосток на нашем складе. Продаются как есть в японской упаковке, без проверки. Мы перепродаем вам право получить товар с японского аукциона купленный на основании предоставленных фото. Товар, его параметры, состояние, комплектация и пр. могут отличаться от фото/описания по вине японской стороны. Данные риски компенсируются низкой ценой, их берет на себя покупатель. Поле износ шин заполнено по нашей субъективной оценке. Реальный остаток смотрите по фото. Других фото, кроме приложенных нет. Товар отправляется вам без проверки, в состоянии, в котором поступил из Японии. '),
(101, 1560, 'Если вы не понимаете чего-то из написанного здесь - не делайте ставок. Делая ставку покупатель соглашается с условиями сделки. Продается право на получение товара поставляемого третьими лицами. \nПродавец обязуется:\n1. Отгрузить товар (колеса б/у), отгруженный продавцом в Японии, после сделки заключенной в Японии на основании представленных фотографий и описания. \n2. Вернуть деньги, если поставка товара не состоялась в течении 60 календарных дней с момента оплаты.\nНикаких гарантий нет. Получаете то, что отправил японец, после того как мы отправили ему деньги по имеющимся фото и описанию. Гарантий, возвратов, возможностей для дискуссий - НЕТ. Требовательных и чувствительных покупателей просим проходить МИМО данного аукциона.\n'),
(101, 1600, '[+VAR=guarantyw_[+INTER=152+]_[+LIST=34+]+]'),
(101, 1601, 'Если вы не понимаете чего-то из написанного здесь - не делайте ставок. Делая ставку покупатель соглашается с условиями сделки. Продается право на получение товара поставляемого третьими лицами. \nПродавец обязуется отгрузить товар (колеса б/у), отгруженный продавцом в Японии, после сделки заключенной в Японии на основании представленных фотографий и описания. \nНикаких гарантий нет. Получаете то, что отправил японец, после того как мы отправили ему деньги по имеющимся фото и описанию. Гарантий, возвратов, возможностей для дискуссий - НЕТ. Требовательных и чувствительных покупателей просим проходить МИМО данного аукциона.'),
(102, 1560, 'Находятся в пути, сроки поставки от указанной даты: 1-10 дней по Японии, 1-15 дней погрузка на корабль, 7-9 дней доставка до таможенного склада, 7-14 дней выход с таможни, 5-12 дней доставка по РФ. Итого 21-60 дней и товар у вас. Если в течение 60 дней вы не получите товар - имеете право на возврат денег в размере уплаченной суммы.\nВозможен самовывоз с нашего склада по г. Владивосток. \nОтправка по РФ 500р. за комплект за услуги по отправке.\nОплата на карту сбербанк/альфабанк, наличными при самовывозе.\n23.09.15	\nэто для наших лотов, т.е. для тех которые куплены уже\nпонял?'),
(102, 1600, '[+VAR=dlvr_[+INTER=152+]+]'),
(102, 1601, 'Возможен самовывоз с нашего склада по г. Владивосток. \nОтправка по РФ 500р. за комплект за услуги по отправке.\nОплата на карту сбербанк/альфабанк, наличными при самовывозе.'),
