(118, 1061, 'Диски поставляются на заказ исключительно по полной предоплате! способы доставки уточняйте по телефону, или напишите сообщение.;Диски на заказ (полная предоплата), не надо звонить с вопросом "в наличии или нет?". Иные подробности уточняйте по телефону.;Диски под заказ (не в наличии!), (только после полной оплаты), способы доставки уточняйте по телефону, или сообщением.;'),
(118, 1062, 'Внимание:;Будьте внимательны:;Важно:'),
(118, 1063, 'на заказ! продаются без шин! Оперативная отгрузка и небольшие сроки поставки;Под заказ, доставка транспортными компаниями. Диски без шин!;Под заказ, поставляются транспортной компанией с центрального склада (без шин)'),
(118, 1065, 'Находимся в Кемерово, но данный товар поставляем под заказ. Возможна отправка по России, в Казахстан, Беларусь. Предоставлю дополнительные фотографии. Без шин; Только диски (без шин). Возможна отправка в Казахстан, Беларусь. Предоставлю доп. фото. Находимся в Кемерово, но данный товар поставляем под заказ.;Находимся в Кемерово, но данный товар поставляем под заказ. Возможна отправка по России. В объявлении только диски;Диски под заказ! (Находятся не в Кемерово) Без шин. Возможна отправка по РФ. Предоставлю доп. фотографии; Диски поставляются в Кемерово под заказ из другого города. Возможна отправка в любой город РФ. Предоставлю доп. фото; Диски на заказ по предоплате! Оплата представителю в Кемерово. В объявлении только диски без шин;'),
(118, 1067, 'диски поставляются в г. Красноярск под заказ, оплата представителю в Красноярске;в г. Красноярск диски поставляются под заказ с наших складов, для регионов сроки доставки до вашего города уточняйте по тел. либо через почту авито, полная предоплата (есть представитель в Красноярске).; Указан телефон представительства в г. Красноярск, диски поставляются под заказ со склада в другом городе, сроки доставки до уточняйте по телефону либо через почту авито. ;'),
(118, 1069, 'Отправка в регионы через транспортные компании;Отправка в регионы транспортными компаниями;'),
(118, 1070, 'Поставляются под заказ. Отправлю в любой город транспортными компаниями.;Поставляются под заказ.'),
(118, 1074, 'Поставляются под заказ, срок поставки обычно не превышает 15ти дней.;Поставляются под заказ, срок 10-15 дней.;Поставляются под заказ, срок поставки 10-15 дней.;Под заказ 8-14 дней;Под заказ 9-15 дней;'),
