(156, 1065, 'Продам (БЕЗ ОБМЕНА!) диски [+ATTR=6+]\nдиаметр [+ATTR=9+], cверловка [+ATTR=5;REPLACE={*=-}+], ширина [+ATTR=31+],`("[+ATTR=32+]"=="")?(""):(" вылет [+ATTR=32+],")``("[+ATTR=33+]"=="")?(""):(" ЦО [+ATTR=33+]мм,")``("[+ATTR=34+]"=="")?(""):(" вес [+ATTR=34+]кг.")` \nДиски не вареные, не гнутые, в том состоянии, которое отображено на фото. Если нужно, могу прислать еще фотографий.\nПри необходимости отправлю в любой город.'),
(156, 1069, 'Поставляются под заказ, [+INTER=83+] дней.\nДиски R[+ATTR=9+]x[+ATTR=31+] [+LIST=105;ITEM=RAND+] [+ATTR=32+] {разболтовка|сверл.|сверловка|со сверловкой} [+ATTR=5;REPLACE={*=x};SEP= и +], [+LIST=109;ITEM=RAND+].\nЦена указана [+LIST=120;ITEM=RAND+]\nОтправлю в любой город транспортной компанией.\nДиски без шин (даже если на фото есть шины). С глупыми вопросами - не звонить, обмен не предлагать.'),
(156, 1074, '`("[+ATTR=9+]"!="")?("Диаметр: [+ATTR=9+]"):("")``("[+ATTR=5+]"!="")?("\\nСверловка:"):("")``(strpos("[+ATTR=5+]","/")===false)?(""):("двойная")` [+ATTR=5+]`("[+ATTR=31+]"!="")?("\\nШирина: "):("")``(strpos("[+ATTR=31+]","/")===false)?(""):("разноширокие")` [+ATTR=31+]`("[+ATTR=32+]"!="")?("\\nВылет: [+ATTR=32+]"):("")``("[+ATTR=33+]"!="")?("\\nДиаметр центр. отверстия: [+ATTR=33+]"):("")``("[+ATTR=34+]"!="")?("Вес: [+ATTR=34+]"):("")``("[+ATTR=11+]"!="")?("\\nСтрана изготовитель: [+ATTR=11+]"):("")``("[+ATTR=28+]"!="")?("\\nКоличество дисков: [+ATTR=28+]"):("")`\nГарантия состояния дисков: не гнутые, не варенные, на ходу не развалятся! Фото соответствуют.\nМожем отправить в любой город.\nДиски продаются без шин!\nОбмен не предлагать!\n\n\nПродам диски [+LIST=109;ITEM=RAND+] `("[+LIST=91+]"==""|"[+LIST=91+]"=="Не указано")?(""):("пр-во [+LIST=91+],")`\nсверловка [+ATTR=5;SEP=-;REPLACE={*=x}+] \nширина [+ATTR=31;SEP=-+]\n[+LIST=118;ITEM=RAND+]\n[^Товар на заказ! ~Без обмена! ~Без шин! ~Подробности по телефону или пишите сообщения.^]\n\n\nТовар находится в разделе ДИСКИ, поэтому продаются БЕЗ шин!\nДиски качественные, в хорошем состоянии, не гнутые, не вареные.`("[+LIST=91+]"=="Не указано")?(""):("\\nСтрана производства дисков: [+LIST=91+].")`\n\nДИАМЕТР [+ATTR=9+]\nСВЕРЛОВКА [+ATTR=5;SEP=-;REPLACE={*=x}+]\nШИРИНА [+ATTR=31;SEP=-+]\nКОЛИЧЕСТВО [+ATTR=28+]'),
(156, 1081, 'Продам диски R[+ATTR=9+]х[+ATTR=31;SEP=-+] дюймов`("[+ATTR=73+]"=="1")?("{, разноширокие|, разноширы|, разношир.}"):("")`.\n[+LIST=116;ITEM=RAND+]\nДиски лежат на складе в Томске, привезены из Японии, [+LIST=119;ITEM=RAND+]\nd - [+ATTR=9+]\nшир. - [+ATTR=31;SEP=-+]\nсверл. - [+ATTR=5;REPLACE={*=x};SEP=-+]\nвыл. - [+ATTR=32;SEP=-+]\n[+LIST=118;ITEM=RAND+]\nБез шин!'),
