(173, 1065, 'Отличные качественные недорогие шины. В хорошем состоянии, без порезов, без грыж. Все имеющиеся недостатки указаны на фото.\nДиаметр [+ATTR=9+]'''', ширина [+ATTR=7+] мм, профиль [+ATTR=8+]%, износ [+ATTR=29+]%.\nОбменом не занимаюсь! Звонить только по поводу покупки!\nТорга нет! \nПродаются только шины (БЕЗ ДИСКОВ)!\n\n\n{Товар поставляется|Поставка|Поставляем|Товар|Данный товар продается} на заказ с нашего склада. Срок поставки уточняйте по телефону или сообщением.\nОбмена нет. Торг минимальный или отсутствует. В объявлении только шины (без дисков)\nдиаметр [+ATTR=9+] ширина [+ATTR=7+] профиль [+ATTR=8+]\n[+ATTR=16+] [+ATTR=17+]\n{Отличные шины за эти деньги|Хорошие шины за умеренную цену|Нормальные шины за нормальную цену|Качественные шины по демократичной цене|Выгодное предложение|Прекрасная цена за такой комплект шин|Для такого состояния шин цена приятная|За такие деньги - отличный вариант шин}\nБолее подробные фото, остаток протектора в мм и другая информация указаны на нашем сайте. По всем вопросам звоните. \n'),
