('disctextother', '[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. [+VAR=drom_tx_disc_other+]\r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n\r\nОписание:\r\n[+VAR=disc_params+]\r\n\r\n`("[+ATTR=38+]"=="Томск")?("Возьму Ваши шины и диски на реализацию."):("")`'),
('disctextw70', '[+LIST=18+] \r\nНаходятся в г. [+ATTR=27+]. Читайте полностью описание и условия продажи. [+VAR=drom_tx_disc_w70+]\r\nПодойдут или нет на ваше авто не знаю. Продаются только диски, без шин. Могу укомплектовать шинами за отдельную плату. Обмен не интересен. \r\nВозможен резерв товара на срок до месяца по предоплате.\r\n\r\nОписание:\r\n[+VAR=disc_params+]\r\n\r\n`("[+ATTR=38+]"=="Томск")?("Возьму Ваши шины и диски на реализацию."):("")`'),
