('disc_params_free', 'Сверловка: [+ATTR=5+]\r\nДиаметр: [+ATTR=9+]\r\nКол-во: [+ATTR=28+] шт.`(strlen("[+ATTR=6+]")>1)?("\\nМодель: [+ATTR=6+]"):(" ")` \r\nШирина: [+ATTR=31+]`("[+ATTR=32+]"==0)?(""):("\\nВылет: [+ATTR=32+]")``("[+ATTR=33+]"==0)?(""):("\\nЦентральное отверстие: [+ATTR=33+]")``("[+ATTR=34+]"==0)?(""):("\\nВес: [+ATTR=34+]")``(strlen("[+ATTR=11+]")>1)?("\\nИзготовитель: [+LIST=91+]"):("")`'),
('dlvry_cost', '(([+TABLE=8+]*250*[+ATTR=42+])<[+TABLE=36+])?([+TABLE=36+]):([+TABLE=8+]*250*[+ATTR=42+])'),
('dlvr_0', 'Товар находится в г. [+ATTR=27+]. При покупке по блиц цене упаковка, доставка до склада ТК ПЭК в нашем городе включены в цену. Сроки отправки товара составляют до 4 дней. наличными, карта сбер, альфабанк'),
('dlvr_1', '`([+ATTR=36+]==1||[+ATTR=36+]==2)?("Наличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией. При покупке по блиц цене упаковка, доставка до склада ТК ПЭК в нашем городе включены в цену"):("Самовывоз, г. [+ATTR=27+]\r\nНаличные, перевод на карту\r\nМогу отправить в любой город транспортной компанией.\r\nСтоимость доставки до тк и оформления документов на отправку [+LIST=19+]р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до тк и оформления документов [+LIST=19+]р. за 4 диска.\r\n\r\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \r\n1. Выбираете тк\r\n2. Вводите название тк в гугл\r\n3. Переходите на сайте в раздел \\"калькулятор\\". \r\nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\r\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\r\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.")`'),
('drom_tx_disc_other', '("[+ATTR=38+]"=="[+ATTR=27+]")?(""):((("[+ATTR=38+]"!="[+ATTR=27+]")&&([+LIST=34+]==0))?("\r\nОтправка до склада ТК в город размещения объявления за мой счет. Могу отправить любой транспортной компанией в любой город за ваш счет."):("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет."))'),
('drom_tx_disc_w70', '([+LIST=33+]==1)?("\r\nЦена указана с учетом доставки на наш склад в г. [+ATTR=38+]. Могу отправить любой транспортной компанией в любой город за ваш счет. "):("\r\nОтправлю любой транспортной компанией в любой город за ваш счет. ")'),
('dr_disc_title', 'Распродажа! Предлагайте цены! [+LIST=31+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+]'),
('dr_disc_title_std', '[+LIST=14+][+ATTR=3+] [+LIST=31;ITEM=1+] `(strlen("[+ATTR=6+]")>1)?("[+ATTR=6+]"):(" ")` R[+ATTR=9+] [+ATTR=5+] [+ATTR=31+]J `("[+ATTR=32+]"=="")?(""):("+[+ATTR=32+] ")``("[+LIST=11+]"=="1")?("([+ATTR=11+])"):("")` [+ATTR=26+]'),
('dr_tire_title', '[+LIST=14+][+ATTR=3+] [+TABLE=6+] [+ATTR=16+] [+ATTR=17+] [+ATTR=7+]/[+ATTR=8+]/[+ATTR=9+] `([+LIST=11+])?("([+ATTR=11+])"):("")` [+ATTR=26+]'),
('guarantyd_0_0', 'Товар б/у, гарантий и возвратов нет. С людьми не понимающими отличие б/у от нового товара - не работаем.\r\nБ/у товар с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров). Если в переписке мы не утверждали проверку дисков на балансире, гарантий на геометрию НЕТ.\r\nНа фото именно эти диски. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в другом месте. Дополнительных фотосессий по вашим капризам не устраиваем. Людей, которые думают, что по доп. фото они смогут определить гнутость дисков или вывести на чистую воду недобросовестного продавца - заслуженно считаем наивными.\r\nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer\r\nОплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра. Покупатель берет на себя риски покупки б/у товара и перевозки дисков транспортной компанией.'),
('guarantyd_0_1', 'Отправляем только по полной предоплате. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Гарантия - что вас не кинут - рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов. После отправки выкладываем фото накладной. Товар б/у, с большой вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров). Все диски осмотрены визуально и проверены на балансировочном станке на погнутости, следы варки, трещины. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра и осмотра на балнсире дефектах. Покупатель берет на себя риски покупки б/у товара и перевозки дисков транспортной компанией. Иных гарантий - нет, возврата - нет. Правила и порядок сделки устанавливаются продавцом и отработаны за 2 года работы. Приходящие со своим уставом покупатели заносятся в черный список без объяснения причин.'),
('guarantyd_1_0', 'Товар б/у, осмотр на месте, проверка на ближайшем шиномонтаже, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
('guarantyd_1_1', 'Для местных - осмотр на месте, проверка на ближайшем шиномонтаже за ваш счет, с учетом разумных затрат моего времени. Товар б/у, имеет следы эксплуатации, гарантий, возвратов - НЕТ.\r\n\r\nВнимание!\r\n1. На вопрос "На мое авто подойдут?" не отвечаю. Параметры в описании, ищите в интернете. Возврата по причине того что вам не подошли купленные диски - НЕТ.\r\n2. На фото именно эти диски. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в своем городе. Дополнительных фотосессий по вашим капризам не устраиваем. Людей, которые думают, что по доп. фото они смогут определить гнутость дисков или вывести на чистую воду недобросовестного продавца - заслуженно считаем наивными.\r\n3. Товар б/у, с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров)\r\n4. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра и осмотра на балнсире дефектах. Покупатель берет на себя риски покупки б/у товара и перевозки дисков транспортной компанией.\r\n5. Правила и порядок сделки устанавливаются продавцом и отработаны за 2 года работы. Приходящие со своим уставом покупатели заносятся в черный список без объяснения причин.\r\n\r\nОтправляем только по полной предоплате.\r\nГарантия - что вас не кинут - рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов.\r\nПосле отправки получаете номер или фото накладной. Не несем ответственности за работу тк.'),
('guarantyt_0_0', 'Товар б/у, имеет следы эксплуатации. Гарантий отсутствия скрытых дефектов - не даем. Иных гарантий, возвратов - нет. Отправляем по полной предоплате. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Гарантия что вас не кинут и качества товара - рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer . Все шины осмотрены визуально, все найденные дефекты отражены на фото.'),
('guarantyt_0_1', 'Гарантия отсутствия грыж и сквозных порезов.  Остальное видно на фото. Иных гарантий, а так же возвратов - нет. Возврата по причине неверного выбора размера и т.п. - НЕТ! С людьми не понимающими отличие б/у от нового товара - не работаем. \r\nТовар б/у, может иметь следы эксплуатации, существенно отличаться от нового. При сохранении возможности использования, претензии не принимаются. \r\nДля регионов - высылаем только по предоплате. Гарантия, что вас не кинут и соответствия качества - наш рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов. После отправки получаете фото накладной.\r\n'),
('guarantyt_1_0', 'Товар б/у, осмотр на месте, проверка на ближайшем шиномонтаже, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
('guarantyt_1_1', 'Гарантия отсутствия грыж и сквозных порезов. Иных гарантий, а так же возвратов - нет. Возврата по причине неверного выбора размера и т.п. - НЕТ!\r\n\r\n1. Для местных - осмотр на месте, проверка на шиномонтаже за ваш счет, с учетом разумных затрат моего времени. Товар б/у, может иметь следы эксплуатации, существенно отличаться от нового. При сохранении возможности использования, претензии не принимаются. \r\n2. Для регионов - высылаем только по предоплате. Гарантия, что вас не кинут и соответствия качества - наш рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов. После отправки получаете фото накладной.\r\n\r\nШины проверены на наличие грыж, шишек и порезов в надутом состоянии. Остальное видно на фото. Без предоплаты доп. фото не делаю. С людьми не понимающими отличие б/у от нового товара - не работаем. \r\nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer'),
('guarantyw_0_0', 'Товар б/у, гарантий и возвратов нет. С людьми не понимающими отличие б/у от нового товара - не работаем.\r\nБ/у товар с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров). Если в переписке мы не утверждали проверку дисков на балансире, гарантий на геометрию НЕТ.\r\nНа фото именно эти колеса. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в другом месте. Дополнительных фотосессий по вашим капризам не устраиваем.\r\nВ подтверждение качества - наша репутация и рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer\r\nОплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра. Покупатель берет на себя риски покупки б/у товара и перевозки колес транспортной компанией.'),
