('guarantyw_1_0', 'Товар б/у, осмотр на месте, проверка на ближайшем шиномонтаже, ВОЗВРАТА И ГАРАНТИЙ - НЕТ.'),
('guarantyw_1_1', 'Для местных - осмотр на месте, проверка на ближайшем шиномонтаже за ваш счет, с учетом разумных затрат моего времени. Товар б/у, имеет следы эксплуатации, гарантий, возвратов - НЕТ.\r\n\r\nВнимание!\r\n1. На вопрос "На мое авто подойдут?" не отвечаю. Параметры в описании, ищите в интернете. Возврата по причине того что вам не подошли купленные диски - НЕТ.\r\n2. На фото именно эти колеса. Фото в полной мере отражает состояние товара (в т.ч. комплектность колпачков, болтов, сосков, и т.д.). Если вас не устраивает качество фото - приходите и смотрите лично или покупайте в своем городе. Дополнительных фотосессий по вашим капризам не устраиваем.\r\n3. Товар б/у, с 99% вероятностью имеет следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, загрязнения, помутнения лкп, необходимость дополнительной балансировки, некомплектность мелких частей и аксессуаров)\r\n4. Оплачивая товар вы подтверждаете ваше согласие с условиями сделки. Продавец обязутеся а) отправить именно то что на фото б) известить покупателя о найденных в процессе визуального осмотра и осмотра  дефектах. Покупатель берет на себя риски покупки б/у товара и перевозки колес транспортной компанией.\r\n5. Правила и порядок сделки устанавливаются продавцом и отработаны за 2 года работы. Приходящие со своим уставом покупатели заносятся в черный список без объяснения причин.\r\n\r\nОтправляем только по полной предоплате.\r\nГарантия - что вас не кинут - рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer а так же большое количество продаваемых лотов.\r\nПосле отправки получаете номер или фото накладной. Не несем ответственности за работу тк.'),
