(104, 72, NULL, NULL, '<h2>Варианты получения товара: </h2>\r\n<h3><span>1. Самовывоз.</span> При наличии представительства в вашем городе.</h3>\r\n<h3><span>2. Доставка транспортной компанией.</span> Осуществляется после полной предоплаты товара. \r\nДоставка осуществляется любыми транспортными компаниями, которые имеются в городе нахождения товара. Мы рекомендуем отправлять ваши покупки транспортными компаниями: </h3>\r\n<ul class="delivery">\r\n<li class="clearfix"><a class="left" href="http://pecom.ru/" target="_blank">ПЭК</a><a class="right" href="http://pecom.ru/services-are/the-calculation-of-the-cost/" target="_blank">(расчет стоимости)</a></li>\r\n<li class="clearfix"><a class="left" href="http://www.dellin.ru/" target="_blank">Деловые линии</a><a  class="right" href="http://www.dellin.ru/requests/" target="_blank">(расчет стоимости)</a></li> \r\n<li class="clearfix"><a class="left" href="http://nrg-tk.ru/" target="_blank">Энергия</a><a  class="right"  href="http://nrg-tk.ru/client/calculator/" target="_blank">(расчет стоимости)</a></li> \r\n<li class="clearfix"><a class="left" href="http://www.rateksib.ru/" target="_blank">РАТЭК</a><a  class="right" href="http://www.rateksib.ru/tarify/" target="_blank">(расчет стоимости)</a></li>\r\n<li class="clearfix"><a class="left" href="http://tk-kit.ru/" target="_blank">КИТ</a> <a  class="right"  href="http://tk-kit.ru/calculate/" target="_blank">(расчет стоимости)</a></li>\r\n</ul>\r\n<p>В карточке товара указывается расчет сроков и стоимости доставки для вашего города. Указанные данные рассчитаны на основе информации предоставленной ТК и являются примерными. Для самостоятельного расчета стоимости услуг ТК через онлайн калькулятор на сайте ТК можно взять следующие данные:<br>\r\n<b>Приблизительные параметры комплекта шин:</b> 0,35м2 - 45кг.<br>\r\n<b>Приблизительные параметры комплекта дисков:</b> 0,22м2 - 45кг.<br>\r\n<b>Приблизительные параметры комплекта колес:</b> 0,4м2 - 85кг. </p>\r\n<h2>При отправке товара ТК действуют следующие правила: </h2>\r\n<h3><span>1. Диски упаковываются нашими сотрудниками.</span></h3>\r\n<h3><span>2. Шины отправляются без упаковки.</span></h3>\r\n<h3><span>3. Дополнительные услуги.</span> По вашему запросу и за ваш счет мы можем заказать дополнительные услуги ТК (палетный борт, обрешетка и т.д.). </h3>\r\n<h3><span>4. Мы не несем ответственности за работу ТК</span> (кража или повреждение товара, нарушение сроков, тарифов и т.д.), однако делаем все возможное для защиты ваших интересов. </h3>\r\n<h3><span>5. Оплата услуг ТК</span> может производиться как нашими сотрудниками, так и самим покупателем при получении (по договоренности с менеджером). </h3>\r\n<h3><span>6. Получение товара в городах, где есть представительства</span> возможно двумя способами:</h3>\r\n<ul>\r\n<li>получение покупателем лично в ТК</li> \r\n<li>получение покупателем в представительстве (может взиматься дополнительная плата)</li>  \r\n</ul>\r\n<h3><span>7. Получение товара в городах без представительства</span> производится покупателем в транспортной компании. </h3>', NULL, NULL),
