(105, 72, NULL, NULL, '<h2>Шины</h2>\r\n<h3>Если в описании не указано иное, то гарантируется: </h3>\r\n<ul>\r\n<li>полное соответствие фото</li>\r\n<li>полное соответствие типоразмера, марки и модели заявленному в описании</li>\r\n<li>соответствие заявленному остатку протектора (с учетом погрешности измерения) </li>\r\n<li>отсутствие грыж, порезов, прочих препятствий к эксплуатации</li>\r\n</ul>\r\n<h3><b>Дефектами не считаются:</b></h3>\r\n<ul>\r\n<li>проколы и шнурки (в количестве не более 2-х на шину)</li>\r\n<li>микротрещины</li>\r\n<li>потертости</li>\r\n<li>мелкие царапины (не затрагивающие корд)</li>\r\n<li>следы шиномонтажа (не препятствующие эксплуатации)</li>\r\n</ul>\r\n<h2>Диски</h2>\r\n<h3>Если в описании не указано иное, то гарантируется: </h3>\r\n<ul>\r\n<li>полное соответствие фото</li>\r\n<li>полное соответствие типоразмера, ширины, вылета, производителя, заявленному в описании</li>\r\n<li>отсутствие погнутостей, восьмерок, следов сварки, трещин</li>\r\n<li>оригинальность фирменного товара (при наличии изначальной информации о производителе) </li>\r\n</ul>\r\n<h3><b>Дефектами не считаются: </b></h3>\r\n<ul>\r\n<li>следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, шиномонтажа, загрязнения, помутнения лкп) </li>\r\n<li>некомплектность или износ мелких частей и аксессуаров (соски, ниппеля, колпачки, съемные ключи, декоративные накладки, болты, наклейки и т.д.) </li>\r\n</ul>\r\n<p>Таким образом, мы&nbsp;гарантируем, что клиент получит именно те&nbsp;шины/диски/колеса, что на&nbsp;фото, они будут держать давление, балансироваться и&nbsp;пригодны к&nbsp;остаточной эксплуатации. В&nbsp;случае получения товара в&nbsp;представительстве обязателен осмотр товара на&nbsp;месте, возможна проверка на&nbsp;шиномонтаже. Дальнейших гарантий и&nbsp;возвратов нет. В&nbsp;случае получения клиентом товара в&nbsp;ТК, ему предоставляются 1 сутки на&nbsp;проверку товара. В&nbsp;случае выявления дефектов, клиент привозит товар в&nbsp;представительство, либо обращается к&nbsp;менеджерам <nobr>интернет-магазина</nobr> по&nbsp;телефону. Возврат денег производится в&nbsp;течение 10 календарных дней. Не&nbsp;подлежат возврату и&nbsp;не&nbsp;принимаются претензии по&nbsp;товарам: со&nbsp;следами установки на&nbsp;машину и&nbsp;эксплуатации в&nbsp;городе получения; со&nbsp;следами некачественного шиномонтажа в&nbsp;городе получения.</p>', NULL, NULL),
