(179, 89, NULL, NULL, 'Вы купили лот\r\n\r\nУбедитесь что вы внимательно прочитали текст объявления и условия гарантии и доставки.\r\nГарантия порядочности сделки - наш рейтинг http://baza.drom.ru/user/wheels70/feedbacks?role=buyer\r\n\r\nДальнейший порядок действий:\r\n\r\n1. Полная оплата на карту\r\n	Оплачиваете товар на одну из карт:\r\n	1. Карта сбербанк 4276 6400 1342 7176 Разумов Андрей Андреевич карта действует до 10/18\r\n	внимание! при отправлении перевода просьба не писать к нему комментариев.\r\n\r\n	2. Счет альфабанк 40817810004390042130 Разумов Андрей Андреевич\r\n\r\n2. Сообщаете нам данные для отправки товара транспортной компанией\r\n\r\n	Для отправки ТК ПЭК необходимо:\r\n\r\n	1. ФИО получателя\r\n	2. Город\r\n	3. Телефон\r\n\r\n3. Проверяем упаковываем и отправляем товар и сообщаем Вам номер транспортной накладной.', NULL, NULL),
