(180, 89, NULL, NULL, '1. Отзывы на дроме\r\nhttp://baza.drom.ru/user/wheels70/feedbacks\r\nГлавный аккаунт вилс70 на сайте дром.ру, более 3х лет работы и больше 250ти положительных отзывов.\r\n2. Ссылка на нас в 2гис\r\nGodzilla Wheels, магазин б/у шин и дисков из Японии\r\nМокрушина, 9 ст42\r\n3. Возможности доп фото товара в подтверждение\r\n4. Документ лица на которое переводят деньги (например в/у)\r\n5. Возможность оплаты через представителя в городах (например друг покупателя идет в екб к егору)', NULL, NULL),
