(202, 102, NULL, NULL, '[++] - оборачиваются интерпретаторы и справочники.\r\n	[+INTER=1+] - возвращает значение интерпретатора под номером "1"\r\n	[+LIST=1+] возвращает значение списка под номером "1"\r\n	[+VAR=fist+] возвращает значение переменной под названием "first"\r\n	[+TABLE=1+] возвращает значение таблицы под номером "1"\r\n	[+CUBE=1+] возвращает значение тремерного массива под номером "1"\r\n\r\n{}  слова для выбора рандомом\r\n	{1|2|3} - возвращает случайно выбранный элемент из перечисленных\r\n[##] элементы для перестановок	\r\n	[#[+LIST=1+]#] [#[+INTER=1+]#] - возвращает случайную перестановку из элементов [+LIST=1+] и [+INTER=1+]\r\n\r\nИспользование условий:\r\n`("[+INTER=1+]"=="4")?("Верно"):("Ошибка")`\r\nЕсли [+INTER=1+] равен "4" то "Верно" иначе "Ошибка".\r\nУсловие обязательно оборачивать в "Апостроф" на русской раскладке клавиатуры это кнопка с буквой "ё".\r\n\r\n\r\nITEM - используется для выбора элемента из массива типа "a;b;c;" \r\n	[+LIST=1;ITEM=2+] - результат "b"\r\n\r\nLAST - выбирает последний элемент из массива a;b;c;. \r\n	[+LIST=1;ITEM=LAST+] - результат "c"\r\n\r\nRAND - выбирает случайный элемент из массива a;b;c;. \r\n	[+LIST=1;ITEM=RAND+] - результат случайное из "a" "b" или "c", \r\n	на данный момент реализовано более удобным способом {a|b|c}\r\n\r\nSEP - заменяет разделитель множественного атрибута \r\n	[ATTR=5*114/4*114;SEP=-] - результат 5*114-4*114, \r\n\r\nALT - [+ATTR=5;ALT=+]\r\n\r\nREPLACE - [+ATTR=5;REPLACE={*=x};SEP=-+] - 5x114-4x114\r\n\r\n`(count(explode("/","[+ATTR=31+]"))==2)?("([+ATTR=31;SEP=|;ITEM=2+])"):("")` - вывод одного элемента из множественного атрибута\r\n[+LIST=3;ITEM=ITER+] - (для уникальных интерпретаторов) берет первый элемент массива, если не уникальное, то берет второй и т. д.\r\n\r\n[#{9|8|7|6}#] [#[+ATTR=3+]#] [#{asda|asadas|asdasd|asdasd}#]\r\n\r\nPHP функции\r\nround(6.3,0)//  =6 округление\r\nfloor(3.99) // 3 округление в меньшую сторону\r\nceil(3.001)// 4 в большую сторону\r\n\r\n* -учитываются все пробелы', NULL, NULL),
