(69, 'Гарантия и условия возврата (магазин)', '<div class="b-text">\r\n<h3>Если в описании не указано иное, то гарантируется: </h3>\r\n<ul>\r\n<li>полное соответствие фото</li>\r\n<li>полное соответствие типоразмера, ширины, вылета, производителя, заявленному в описании</li>\r\n<li>отсутствие погнутостей, восьмерок, следов сварки, трещин</li>\r\n<li>оригинальность фирменного товара (при наличии изначальной информации о производителе)</li>\r\n</ul>\r\n<h3><b>Дефектами не считаются:</b></h3>\r\n<ul>\r\n<li>следы эксплуатации (царапины, сколы, следы коррозии, ржавчины, тормозной пыли, шиномонтажа, загрязнения, помутнения лкп)</li>\r\n<li>некомплектность или износ мелких частей и аксессуаров (соски, ниппеля, колпачки, съемные ключи, декоративные накладки, болты, наклейки и т.д.)</li>\r\n</ul>\r\n<p>Таким образом, мы&nbsp;гарантируем, что клиент получит именно те&nbsp;диски, что на&nbsp;фото, они будут держать давление, балансироваться и&nbsp;пригодны к&nbsp;остаточной эксплуатации. В&nbsp;случае получения товара в&nbsp;представительстве обязателен осмотр товара на&nbsp;месте, возможна проверка на&nbsp;шиномонтаже. Дальнейших гарантий и&nbsp;возвратов нет. В&nbsp;случае получения клиентом товара в&nbsp;ТК, ему предоставляются 1 сутки на&nbsp;проверку товара. В&nbsp;случае выявления дефектов, клиент привозит товар в&nbsp;представительство, либо обращается к&nbsp;менеджерам <nobr>интернет-магазина</nobr> по&nbsp;телефону. Возврат денег производится в&nbsp;течение 10 календарных дней. Не&nbsp;подлежат возврату и&nbsp;не&nbsp;принимаются претензии по&nbsp;товарам: со&nbsp;следами установки на&nbsp;машину и&nbsp;эксплуатации в&nbsp;городе получения; со&nbsp;следами некачественного шиномонтажа в&nbsp;городе получения.</p>\r\n</div>', 2, 'managerActions', 0, 5, 1, 0),
(70, 'Гарантия и условия возврата (магазин) ', '<div class="b-text">\r\n<h3>Если в описании не указано иное, то гарантируется: </h3>\r\n<ul>\r\n<li>полное соответствие фото</li>\r\n<li>полное соответствие типоразмера, марки и модели заявленному в описании</li>\r\n<li>соответствие заявленному остатку протектора (с учетом погрешности измерения) </li>\r\n<li>отсутствие грыж, порезов, прочих препятствий к эксплуатации</li>\r\n</ul>\r\n<h3><b>Дефектами не считаются:</b></h3>\r\n<ul>\r\n<li>проколы и шнурки (в количестве не более 2-х на шину)</li>\r\n<li>микротрещины</li>\r\n<li>потертости</li>\r\n<li>мелкие царапины (не затрагивающие корд)</li>\r\n<li>следы шиномонтажа (не препятствующие эксплуатации)</li>\r\n</ul>\r\n<p>Таким образом, мы&nbsp;гарантируем, что клиент получит именно те&nbsp;шины, что на&nbsp;фото, они будут держать давление, балансироваться и&nbsp;пригодны к&nbsp;остаточной эксплуатации. В&nbsp;случае получения товара в&nbsp;представительстве обязателен осмотр товара на&nbsp;месте, возможна проверка на&nbsp;шиномонтаже. Дальнейших гарантий и&nbsp;возвратов нет. В&nbsp;случае получения клиентом товара в&nbsp;ТК, ему предоставляются 1 сутки на&nbsp;проверку товара. В&nbsp;случае выявления дефектов, клиент привозит товар в&nbsp;представительство, либо обращается к&nbsp;менеджерам <nobr>интернет-магазина</nobr> по&nbsp;телефону. Возврат денег производится в&nbsp;течение 10 календарных дней. Не&nbsp;подлежат возврату и&nbsp;не&nbsp;принимаются претензии по&nbsp;товарам: со&nbsp;следами установки на&nbsp;машину и&nbsp;эксплуатации в&nbsp;городе получения; со&nbsp;следами некачественного шиномонтажа в&nbsp;городе получения.</p>\r\n</div>', 1, 'managerActions', 0, 5, 1, 0),
(71, 'Описание (магазин)', '<div class="b-text">\r\n`("[+ATTR=27+]"=="")?(""):("<h2>Данные диски находятся на&nbsp;складе <b>в&nbsp;г.&nbsp;[+ATTR=27+]</b></h2>")`\r\n<h3>[+LIST=131+]</h3>\r\n<h3>`("[+ATTR=35+]"=="")?(""):("<b>Примечание к товару:</b> [+ATTR=35+]")`</h3>\r\n<h3>Фотографии в&nbsp;полной мере отображают состояние товара. По&nbsp;вашему запросу мы&nbsp;можем предоставить дополнительные фото.</h3>\r\n<p>Сотрудники нашего магазина всегда готовы помочь и&nbsp;подсказать вам. Однако обратите внимание, что мы&nbsp;не&nbsp;занимаемся подбором дисков по&nbsp;марке автомобиля. Мы&nbsp;указываем все известные параметры товара в&nbsp;описании, покупатели самостоятельно сравнивают их&nbsp;с&nbsp;параметрами своего автомобиля.</p>\r\n<p>Возможен резерв товара на&nbsp;срок до&nbsp;месяца по&nbsp;предоплате, условия обсуждаются индивидуально.</p>\r\n</div>', 2, 'managerActions', 0, 5, 1, 0),
(72, 'Описание (магазин)', '<div class="b-text">\r\n`("[+ATTR=27+]"=="")?(""):("<h2>Данные шины находятся на&nbsp;складе <b>в&nbsp;г.&nbsp;[+ATTR=27+]</b></h2>")`\r\n<h3> `("[+ATTR=35+]"=="")?(""):("<b>Примечание к товару:</b> [+ATTR=35+]")`</h3>\r\n<h3>Фотографии в&nbsp;полной мере отображают состояние товара. По&nbsp;вашему запросу мы&nbsp;можем предоставить дополнительные фото.</h3>\r\n<p>Сотрудники нашего магазина всегда готовы помочь и&nbsp;подсказать вам. Однако обратите внимание, что мы&nbsp;не&nbsp;занимаемся подбором дисков по&nbsp;марке автомобиля. Мы&nbsp;указываем все известные параметры товара в&nbsp;описании, покупатели самостоятельно сравнивают их&nbsp;с&nbsp;параметрами своего автомобиля.</p>\r\n<p>Возможен резерв товара на&nbsp;срок до&nbsp;месяца по&nbsp;предоплате, условия обсуждаются индивидуально.</p>\r\n</div>', 1, 'managerActions', 0, 5, 1, 0),
